  function() { return {"add_course_assignments_628ed6d0":"Tāpiri Whakataunga akoranga","add_course_calendar_events_146154a5":"Tāpiri Akoranga Maramataka Tauwhāinga","add_files_to_the_course_da6ffd32":"Āpitihia ngā kōnae ki te akoranga","add_students_to_the_course_874be8fb":"Tāpiri ngā ākonga ki te Akoranga","add_tas_to_the_course_2aac6e02":"Tāpiri Tas ki te Akoranga","add_your_assignments_you_can_just_make_a_long_list_8a7862dd":"Tāpiri ō whakataunga Ka taea e koe te hanga tika i te rārangi roa, rānei pakaru ratou ki runga ki ngā rōpū - a tae noa whakapūtā pauna mo ia rōpū whakataunga.","all_finished_time_to_publish_your_course_click_the_b6f07217":"Oti katoa? Wā ki te whakaputa i tō akoranga! Pāwhiritia te pātene o raro hei hanga mōhiohio reira! Ka tukua Whakaputa i te kaiwhakamahi ki te timata whai wāhi i roto i te akoranga","by_default_all_links_are_enabled_for_a_course_stud_8e617dbc":"Hei kōwhiringa aunoa, kua whakāetia ngā aho katoa mō te kaupapa. E kore ngā ākonga e kite aho ki ngā wāhanga wātea. Hei tauira, mena kāore anō koe kia whakarite wero hinengaro, e kore ngā ākonga e kite i te aho ki ngā wero hinengaro. Ka āhei tō kōmiri me te whakatārewa hoki i ngā aho mehemea he takiwā e hiahiatia ana kia noh tapu i ngā ākonga.","choose_a_course_home_page_8059c7b":"Kōwhiria he Whārangi Kāinga Akoranga","close_and_return_to_canvas_80544344":"Katia me hoki ki Canvas","course_setup_wizard_is_showing_a7c087c1":"Kei te whakātu Ruānuku Tatūnga Akoranga","course_wizard_31c87552":"Akoranga Ruānuku","great_so_you_ve_got_a_course_now_what_well_before__38cfba67":"Nui, kua whiwhi koe he akoranga. Na te aha? Ana, i mua i te haere koe ki te whakaputa ki te ao, kia hiahia ana koe ki te tirohia, a kia tino mau koe i te taketake whakatakotoria i roto. Mahi i roto i te rārangi i runga i te maui ki te āta whakarite i te rite ki te whakamahi i tō akoranga","here_s_a_great_chance_to_get_to_know_the_calendar__187ce49":"tēnei te wā hei tiki ki te mohio ki te maramataka, me te tāpiri i tētahi tauwhāinga hopoia-kore ai koe ki te akoranga te. Kaua e manukanuka, ka tauturu ia matou ki a koutou i roto i te reira.","if_you_ve_been_using_another_course_management_sys_67edfab1":"Ki te kua i whakamahi koe i tētahi atu pūnaha whakahaere akoranga, pea ia koe i mea i roto i reira e e haere koe ki te e hiahia nekehia ki runga ki Canvas. E nehenehe tatou e te haere koe i roto i te tukanga o te ngāwari heke koutou ihirangi ki Canvas.","import_content_b2fd6620":"Kawemai Ihirangi","item_complete_d334fd43":"(Whakaotia te tūemi)","item_incomplete_d6a16040":"(tūemi pahara)","loaded_more_collaborations_13f1d630":"Utaina mahi ngātahi atu.","my_dashboard_b724020":"toku Papatohu","next_steps_ce0f0d0c":"Hipanga i muri ake nei","now_that_your_course_is_set_up_and_available_you_p_c0c8635c":"Na e whakatakotoria tou akoranga ake me wātea, pea e kore e hiahia ana koe i tēnei rārangi arowhai a muri ake. Ka pupuritia e mātou na te mea ka hiahia pea koe ki te mahi tētahi hou, ara ka hiahia āwhina atu koe i te wā e hurihia naa e koe to ihirangi akoranga.","publish_the_course_f2f6ef80":"Whakaputa i te Akoranga","select_navigation_links_68e1e924":"Tīpako Hononga whakaterenga","setup_checklist_eb8b00b8":"Rārangi Arowhai Tatūnga","the_files_tab_is_the_place_to_share_lecture_slides_95a93bce":"Ko te ripa Kōnae ko te wāhi ki te tuari i ngā kiriata kauhau, tuhinga tauira, tauturu ako - tētahi mea e hiahia ana tō ākonga ki te tiki. tukuake a te whakarite tō kōnae he ngāwari ki Canvas. Ka Whakātu mātou me pehea.","this_course_is_claimed_and_ready_but_you_ll_need_t_25b95a0a":"Kī tēnei akoranga te me rite, engari ka hiahia koe ki te whakaoti i te tukanga rēhita koe i mua i taea te whakaputa i te akoranga. Penei kua riro mai e koe he īmēra i Canvas ki te hono ki te whakaoti i te tukanga. Kia tino ki te tirohia tō pouaka pāme.","this_course_is_visible_only_to_teachers_until_it_i_ce972f0":"Ko te kitea tēnei akoranga anake ki ngā kaiako kua whakaputaina noa te reira.","when_people_visit_the_course_this_is_the_page_they_de94acc2":"Ki te tae mai he manuhiri ki te kaupapa, ko tēnei te whārangi ka kitea e rātou. Ka tāea e koe te whakarite kia wātea tā rātou kite i te au mahi, he rārangi ngohe-ā-kaupapa, te marautanga, ka tāea rānei e koe te whakarite i tētahi whārangi motuhake. Ko te au mahi kaupapa te whakaritenga aunoa.","you_do_not_have_permission_to_publish_this_course_ff361c82":"E kore koe e whai whakāetanga ki te whakaputa i tēnei akoranga.","you_ll_definitely_want_some_of_these_what_s_the_fu_f4f3578b":"Ka hiahia tino koe etahi o enei. He aha te ngahau o te ako i te akoranga, ki te kore ngā tāngata i te whakarongo?","you_may_want_to_assign_some_tas_to_help_you_with_t_702244aa":"Kia hiahia ana koe ki te tautapa i te tahi tas ki te āwhina ia koe ki te akoranga. Tas taea tāpaetanga ākonga kōeke, te tauturu te whakaōrite i te kōrero, me te noa te whakahou e tika ana rā, me ngā taipitopito whakataunga hoki tō."} },
